


App.Modules.Auth = class extends Colibri.Modules.Module {

    _mainFrame = null;

    /** @constructor */
    constructor() {
        super('Auth');
        
    }

    InitializeModule() {
        super.InitializeModule();
        console.log('Initializing module Auth');
        
        this._store = App.Store.AddChild('app.auth', {});
        this._store.AddPathLoader('auth.menu', 'Auth:Auth.Menu');
        this._store.AddPathLoader('auth.settings', 'Auth:Auth.Settings');
        this._store.AddPathLoader('auth.page', () => this.Page(App.Router?.current ?? '/', App.Router?.options ?? {}, true));
        
    }

    Render() {
        console.log('Rendering Module Auth');    
        
        App.Router.AddRoutePattern('/', (url, options) => {
            url = url.urlinfo();
            this.SelectMenuItem(url.url, url.options);
            return false;
        });
        
        this.MainFrame.Show();
    }

    RegisterEvents() {
        console.log('Registering module events for Auth');
    }

    RegisterEventHandlers() {
        console.log('Registering event handlers for Auth');
    }

}

